// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import SabpaisaPaymentGateway from './SabpaisaPaymentGateway';
import TodoApp from './TodoApp';
const App = () => {
  // State to manage payment status
  const [isPaymentSuccessful, setIsPaymentSuccessful] = useState(false);

  return (
    <Router>
      <Routes>
        <Route 
          exact path="/" 
          element={<SabpaisaPaymentGateway setIsPaymentSuccessful={setIsPaymentSuccessful} />} 
        />
        <Route 
          path="/protected" 
          element={isPaymentSuccessful ? <TodoApp /> : <Navigate to="/" />} 
        />
        {/* Add any other routes you need */}
      </Routes>
    </Router>
  );
};

export default App;
